(12, 4, 1687443295, 1687436561, 1, 0, 0, 0, 0, '', 64, NULL, 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 1, 1, 31, 27, 0, 'Mointainbike', '/mointainbike', 137, NULL, 0, 0, '', 0, 0, '', 0, '', 0, 0, NULL, 0, '', 0, NULL, 0, 1687443295, 'm Gegensatz zum Citybike ist das Mountainbike besonders gut für schwieriges Gelände geeignet. Es besitzt flexible Federungssysteme und überzeugende Bremsen. Planst Du eine längere Tour, ist der Sattel womöglich nicht so bequem. Du könntest ihn für den Ausflug jedoch austauschen.', '', 0, '', '', '', 0, 0, 0, 0, 0, 0, '', '', NULL, 0, '', 0, 0, '', NULL, 0, '', NULL, 0, 'summary', '', '0.5', '', 0, NULL, NULL, 0, 0, '', '', 0, 1, 1, 1687443295, 0, 6, 2023, '0', '0', '0', '', '', 0, 0),
(13, 4, 1687443282, 1687436583, 1, 0, 0, 0, 0, '', 32, NULL, 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 1, 1, 31, 27, 0, 'Trekkingbike', '/trekkingbike', 137, NULL, 0, 0, '', 0, 0, '', 0, '', 0, 0, NULL, 0, '', 0, NULL, 0, 1687443282, 'Eine Art Mischung aus Citybike und Mountainbike ist das sogenannte Trekkingrad. Wie das Citybike verfügt es ebenfalls über die laut StVZO notwendige Grundausstattung, wie den Gepäcksträger, und auch in ihrer Bauweise ähneln sich Citybike und Trekkingrad. Letzteres ist allerdings etwas sportlicher und leichter.', '', 0, '', '', '', 0, 0, 0, 0, 0, 0, '', '', NULL, 0, '', 0, 0, '', NULL, 0, '', NULL, 0, 'summary', '', '0.5', '', 0, NULL, NULL, 0, 0, '', '', 0, 1, 1, 1687443282, 0, 6, 2023, '0', '0', '0', '', '', 0, 0),
(14, 4, 1687443268, 1687436612, 1, 0, 0, 0, 0, '', 16, NULL, 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 1, 1, 31, 27, 0, 'Gravelbike', '/default-title', 137, NULL, 0, 0, '', 0, 0, '', 0, '', 0, 0, NULL, 0, '', 0, NULL, 0, 1687443268, 'Gravelbikes (deutsch etwa „Schotter-Räder“) sind geländegängige Fahrräder, die von den weniger alltagstauglichen Cyclocross-Rädern abstammen und auch Querfeldeinrad bzw. Crossrad genannt werden. Heute werden etwas breitere Reifen (28 Zoll, Breite ca. 35–47 Millimeter) benutzt, früher waren die größeren Schlauchreifen mit 27 Zoll und Breiten bis 35 Millimeter üblich.', '', 0, '', '', '', 0, 0, 0, 0, 0, 0, '', '', NULL, 0, '', 0, 0, '', NULL, 0, '', NULL, 0, 'summary', '', '0.5', '', 0, NULL, NULL, 0, 0, '', '', 0, 1, 1, 1687443268, 0, 6, 2023, '0', '0', '0', '', '', 0, 0),
(15, 4, 1687443258, 1687436643, 1, 0, 0, 0, 0, '', 8, NULL, 0, 0, 0, 0, NULL, 0, , 0, 0, 0, 0, 1, 1, 31, 27, 0, 'Rennradrad', '/rennradrad', 137, NULL, 0, 0, '', 0, 0, '', 0, '', 0, 0, NULL, 0, '', 0, NULL, 0, 1687443258, 'Ein Rennrad ist insbesondere für alle, die das Fahrradfahren als Sport betreiben möchten, gedacht. Durch sein geringes Gewicht und seine Bauweise kannst du mit dem Rennrad hohe Geschwindigkeiten erreichen. Aufgrund von seinen dünnen Reifen solltest du mit dem klassischen Rennrad nur auf Asphalt fahren.', '', 0, '', '', '', 0, 0, 0, 0, 0, 0, '', '', NULL, 0, '', 0, 0, '', NULL, 0, '', NULL, 0, 'summary', '', '0.5', '', 0, NULL, NULL, 0, 0, '', '', 0, 1, 1, 1687443258, 0, 6, 2023, '0', '0', '0', '', '', 0, 0),
