(147, 1687440564, 1, 'BE', 1, 0, 5, 'tt_content', '{\"uid\":5,\"rowDescription\":\"\",\"pid\":12,\"tstamp\":1687440564,\"crdate\":1687440564,\"cruser_id\":1,\"deleted\":0,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"sorting\":256,\"editlock\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l10n_source\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l18n_diffsource\":\"\",\"t3ver_oid\":0,\"t3ver_wsid\":0,\"t3ver_state\":0,\"t3ver_stage\":0,\"CType\":\"textmedia\",\"header\":\"Was ist ein Mountainbike?\",\"header_position\":\"\",\"bodytext\":\"<p>Im Gegensatz zum Citybike ist das <strong>Mountainbike <\\/strong>besonders gut f\\u00fcr schwieriges Gel\\u00e4nde geeignet. Es besitzt flexible Federungssysteme und \\u00fcberzeugende Bremsen. Planst Du eine l\\u00e4ngere Tour, ist der Sattel wom\\u00f6glich nicht so bequem. Du k\\u00f6nntest ihn f\\u00fcr den Ausflug jedoch austauschen.<\\/p>\\r\\n<p>Beachte dabei, dass ein Mountainbike in der Regel <a href=\\\"https:\\/\\/planetoutdoor.de\\/wissen\\/auf-fahrradtour\\/fahrrad-verkehrssicher\\\" target=\\\"_blank\\\">nicht gem\\u00e4\\u00df der StVZO ausgestattet<\\/a> ist. Es kann also problematisch sein, diesen Fahrradtyp im Alltag zu fahren. Dar\\u00fcber hinaus ist der Rollwiderstand bei einem Mountainbike hoch.<\\/p>\",\"bullets_type\":0,\"uploads_description\":0,\"uploads_type\":0,\"assets\":0,\"image\":0,\"imagewidth\":0,\"imageorient\":0,\"imagecols\":1,\"imageborder\":0,\"media\":0,\"layout\":0,\"frame_class\":\"default\",\"cols\":0,\"space_before_class\":\"\",\"space_after_class\":\"\",\"records\":null,\"pages\":null,\"colPos\":0,\"subheader\":\"\",\"header_link\":\"\",\"image_zoom\":0,\"header_layout\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"linkToTop\":0,\"file_collections\":null,\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"target\":\"\",\"date\":0,\"recursive\":0,\"imageheight\":0,\"pi_flexform\":null,\"accessibility_title\":\"\",\"accessibility_bypass\":0,