(159, 1687440753, 1, 'BE', 1, 0, 6, 'tt_content', '{\"uid\":6,\"rowDescription\":\"\",\"pid\":13,\"tstamp\":1687440753,\"crdate\":1687440753,\"cruser_id\":1,\"deleted\":0,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"sorting\":256,\"editlock\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l10n_source\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l18n_diffsource\":\"\",\"t3ver_oid\":0,\"t3ver_wsid\":0,\"t3ver_state\":0,\"t3ver_stage\":0,\"CType\":\"textmedia\",\"header\":\"Was sind Trekkingbikes?\",\"header_position\":\"\",\"bodytext\":\"<p>Eine Art Mischung aus Citybike und Mountainbike ist das sogenannte <strong>Trekkingrad<\\/strong>. Wie das Citybike verf\\u00fcgt es ebenfalls \\u00fcber die laut StVZO notwendige Grundausstattung, wie den Gep\\u00e4ckstr\\u00e4ger, und auch in ihrer Bauweise \\u00e4hneln sich Citybike und Trekkingrad. Letzteres ist allerdings etwas sportlicher und leichter.<\\/p>\\r\\n<p>Das Trekkingrad ist insbesondere f\\u00fcr l\\u00e4ngere Fahrrad-Touren, bei denen du mehrere Tage unterwegs bist, konzipiert. Durch seine breiten Reifen lassen sich auch leichte Gel\\u00e4ndepassagen abseits von Asphaltstra\\u00dfen bew\\u00e4ltigen.<\\/p>\",\"bullets_type\":0,\"uploads_description\":0,\"uploads_type\":0,\"assets\":0,\"image\":0,\"imagewidth\":0,\"imageorient\":0,\"imagecols\":1,\"imageborder\":0,\"media\":0,\"layout\":0,\"frame_class\":\"default\",\"cols\":0,\"space_before_class\":\"\",\"space_after_class\":\"\",\"records\":null,\"pages\":null,\"colPos\":0,\"subheader\":\"\",\"header_link\":\"\",\"image_zoom\":0,\"header_layout\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"linkToTop\":0,\"file_collections\":null,\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"target\":\"\",\"date\":0,\"recursive\":0,\"imageheight\":0,\"pi_flexform\":null,\"accessibility_title\":\"\",\"accessibility_bypass\":0,\"accessibility_bypass_text\":\"\",\"category_field\":\"\",\"table_class\":\"\",\"table_caption\":null,