(163, 1687441008, 1, 'BE', 1, 0, 7, 'tt_content', '{\"uid\":7,\"rowDescription\":\"\",\"pid\":14,\"tstamp\":1687441008,\"crdate\":1687441008,\"cruser_id\":1,\"deleted\":0,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"sorting\":256,\"editlock\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l10n_source\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l18n_diffsource\":\"\",\"t3ver_oid\":0,\"t3ver_wsid\":0,\"t3ver_state\":0,\"t3ver_stage\":0,\"CType\":\"textmedia\",\"header\":\"Was sind Gravelbikes?\",\"header_position\":\"\",\"bodytext\":\"<p><strong>ravelbikes<\\/strong> (deutsch etwa \\u201eSchotter-R\\u00e4der\\u201c) sind gel\\u00e4ndeg\\u00e4ngige Fahrr\\u00e4der, die von den weniger alltagstauglichen Cyclocross-R\\u00e4dern abstammen und auch Querfeldeinrad bzw. Crossrad genannt werden. Heute werden etwas breitere Reifen (28 Zoll, Breite ca. 35\\u201347 Millimeter) benutzt, fr\\u00fcher waren die gr\\u00f6\\u00dferen Schlauchreifen mit 27 Zoll und Breiten bis 35 Millimeter \\u00fcblich.<\\/p>\\r\\n<p>\\u00dcblicherweise werden die R\\u00e4der ohne Stra\\u00dfenvehrkehrszulassung, insbesondere ohne Licht sowie Schutzbleche und auch ohne Gep\\u00e4cktr\\u00e4ger verkauft, sind aber in der Regel nachr\\u00fcstbar. Nicht un\\u00fcblich unter reisenden Gravelbikern ist allerdings auch das sogenannte \\u201eBikepacking\\u201c ohne angebrachte Gep\\u00e4cktr\\u00e4ger, wo mitgef\\u00fchrte Taschen direkt an Rahmendreieck, Gabelholme, Lenker und Sattelst\\u00fctze (\\u201eArschrakete\\u201c) angebracht werden.<\\/p>\",\"bullets_type\":0,\"uploads_description\":0,\"uploads_type\":0,\"assets\":0,\"image\":0,\"imagewidth\":0,\"imageorient\":0,\"imagecols\":1,\"imageborder\":0,\"media\":0,\"layout\":0,\"frame_class\":\"default\",\"cols\":0,\"space_before_class\":\"\",\"space_after_class\":\"\",\"records\":null,\"pages\":null,\"colPos\":0,\"subheader\":\"\",\"header_link\":\"\",\"image_zoom\":0,\"header_layout\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"linkToT