(167, 1687441096, 1, 'BE', 1, 0, 8, 'tt_content', '{\"uid\":8,\"rowDescription\":\"\",\"pid\":15,\"tstamp\":1687441096,\"crdate\":1687441096,\"cruser_id\":1,\"deleted\":0,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"sorting\":256,\"editlock\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l10n_source\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l18n_diffsource\":\"\",\"t3ver_oid\":0,\"t3ver_wsid\":0,\"t3ver_state\":0,\"t3ver_stage\":0,\"CType\":\"textmedia\",\"header\":\"Was ist ein Rennrad?\",\"header_position\":\"\",\"bodytext\":\"<p>Ein <strong>Rennrad <\\/strong>ist insbesondere f\\u00fcr alle, die das Fahrradfahren als Sport betreiben m\\u00f6chten, gedacht. Durch sein geringes Gewicht und seine Bauweise kannst du mit dem Rennrad hohe Geschwindigkeiten erreichen. Aufgrund von seinen d\\u00fcnnen Reifen solltest du mit dem klassischen Rennrad nur auf Asphalt fahren.<\\/p>\\r\\n<p>Mit Cyclocross und Gravel Bikes haben sich in den letzten Jahren zwei Rennrad-Varianten etabliert, die auch auf unwegsamerem Gel\\u00e4nde gut zurechtkommen.<\\/p>\",\"bullets_type\":0,\"uploads_description\":0,\"uploads_type\":0,\"assets\":0,\"image\":0,\"imagewidth\":0,\"imageorient\":0,\"imagecols\":1,\"imageborder\":0,\"media\":0,\"layout\":0,\"frame_class\":\"default\",\"cols\":0,\"space_before_class\":\"\",\"space_after_class\":\"\",\"records\":null,\"pages\":null,\"colPos\":0,\"subheader\":\"\",\"header_link\":\"\",\"image_zoom\":0,\"header_layout\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"linkToTop\":0,\"file_collections\":null,\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"target\":\"\",\"date\":0,\"recursive\":0,\"imageheight\":0,\"pi_flexform\":null,\"accessibility_title\":\"\",\"accessibility_bypass\":0,\"accessibility_bypass_text\":\"\",\"category_field\":\"\",\"table_class\":\"\",\"table_caption\":null,\"table_delimiter\":124,\"table_enclosure\":0,\"table_header_position\":0,\"table_tfoot\":0,\"categories\":0,\"select