(201, 1687442601, 2, 'BE', 1, 0, 12, 'pages', '{\"oldRecord\":{\"abstract\":null,\"authors\":\"2\"},\"newRecord\":{\"abstract\":\"m Gegensatz zum Citybike ist das Mountainbike besonders gut f\\u00fcr schwieriges Gel\\u00e4nde geeignet. Es besitzt flexible Federungssysteme und \\u00fcberzeugende Bremsen. Planst Du eine l\\u00e4ngere Tour, ist der Sattel wom\\u00f6glich nicht so bequem. Du k\\u00f6nntest ihn f\\u00fcr den Ausflug jedoch austauschen.\",\"authors\":\"\"}}', 0, '0400$7edb553c406147939bfdcc287ad9b56b:d6f57183d4ec29f4a568a174f36b861b'),
