(203, 1687442622, 2, 'BE', 1, 0, 13, 'pages', '{\"oldRecord\":{\"abstract\":null},\"newRecord\":{\"abstract\":\"Eine Art Mischung aus Citybike und Mountainbike ist das sogenannte Trekkingrad. Wie das Citybike verf\\u00fcgt es ebenfalls \\u00fcber die laut StVZO notwendige Grundausstattung, wie den Gep\\u00e4ckstr\\u00e4ger, und auch in ihrer Bauweise \\u00e4hneln sich Citybike und Trekkingrad. Letzteres ist allerdings etwas sportlicher und leichter.\"}}', 0, '0400$5788b6df81261d718dc4666e32ad5f44:8a89606121863fe3a2ec2ea63ba83d69'),
