(205, 1687442647, 2, 'BE', 1, 0, 14, 'pages', '{\"oldRecord\":{\"abstract\":null},\"newRecord\":{\"abstract\":\"Gravelbikes (deutsch etwa \\u201eSchotter-R\\u00e4der\\u201c) sind gel\\u00e4ndeg\\u00e4ngige Fahrr\\u00e4der, die von den weniger alltagstauglichen Cyclocross-R\\u00e4dern abstammen und auch Querfeldeinrad bzw. Crossrad genannt werden. Heute werden etwas breitere Reifen (28 Zoll, Breite ca. 35\\u201347 Millimeter) benutzt, fr\\u00fcher waren die gr\\u00f6\\u00dferen Schlauchreifen mit 27 Zoll und Breiten bis 35 Millimeter \\u00fcblich.\"}}', 0, '0400$6d2013bbf39fa426c52856a5868078cb:aaa274fb7a5f76c9749f1b2c8fba84a4'),
(206, 1687442647, 2, 'BE', 1, 0, 10, 'sys_file_reference', '{\"oldRecord\":{\"l10n_diffsource\":\"\"},\"newRecord\":{\"l10n_diffsource\":\"{\\\"title\\\":\\\"\\\",\\\"description\\\":\\\"\\\",\\\"uid_local\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\"}\"}}', 0, '0400$6d2013bbf39fa426c52856a5868078cb:b34a074e38840d41041eaee66c42bb0d'),
(207, 1687442664, 2, 'BE', 1, 0, 7, 'tt_content', '{\"oldRecord\":{\"bodytext\":\"<p><strong>ravelbikes<\\/strong> (deutsch etwa \\u201eSchotter-R\\u00e4der\\u201c) sind gel\\u00e4ndeg\\u00e4ngige Fahrr\\u00e4der, die von den weniger alltagstauglichen Cyclocross-R\\u00e4dern abstammen und auch Querfeldeinrad bzw. Crossrad genannt werden. Heute werden etwas breitere Reifen (28 Zoll, Breite ca. 35\\u201347 Millimeter) benutzt, fr\\u00fcher waren die gr\\u00f6\\u00dferen Schlauchreifen mit 27 Zoll und Breiten bis 35 Millimeter \\u00fcblich.<\\/p>\\r\\n<p>\\u00dcblicherweise werden die R\\u00e4der ohne Stra\\u00dfenvehrkehrszulassung, insbesondere ohne Licht sowie Schutzbleche und auch ohne Gep\\u00e4cktr\\u00e4ger verkauft, sind aber in der Regel nachr\\u00fcstbar. Nicht un\\u00fcblich unter reisenden Gravelbikern ist allerdings auch das sogenannte \\u201eBikepacking\\u201c ohne angebrachte Gep\\u00e4cktr\\u00e4ger, wo mitgef\\u00fchrte Taschen direkt an Rahmendreieck, Gabelholme, Lenker und Sattelst\\u00fctze (\\u201eArschrakete\\u201c) angebracht werden.<\\/p>\",\"l18n_diffsource\":\"\"},\"newRecord\":{\"bodytext\":\"<p><strong>Gravelbikes<\\/strong> (deutsch etwa \\u201eSchotter-R\\u00e4der\\u201c) sind gel\\u00e4ndeg\\u00e4ngige Fahrr\\u00e4der, die von den weniger alltagstauglichen Cyclocross-R\\u00e4dern abstammen und auch Querfeldeinrad bzw. Crossrad genannt werden. Heute werden etwas breitere Reifen (28 Zoll, Breite ca. 35\\u201347 Millimeter) benutzt, fr\\u00fcher waren die gr\\u00f6\\u00dferen Schlauchreifen mit 27 Zoll und Breiten bis 35 Millimeter \\u00fcblich.<\\/p>\\r\\n<p>\\u00dcblicherweise werden die R\\u00e4der ohne Stra\\u00dfenvehrkehrszulassung, insbesondere ohne Licht sowie Schutzbleche und auch ohne Gep\\u00e4cktr\\u00e4ger verkauft, sind aber in der Regel nachr\\u00fcstbar. Nicht un\\u00fcblich unter reisenden Gravelbikern ist allerdings auch das sogenannte \\u201eBikepacking\\u201c ohne angebrachte Gep\\u00e4cktr\\u00e4ger, wo mitgef\\u00fchrte Taschen direkt an Rahmendreieck, Gabelholme, Lenker und Sattelst\\u00fctze (\\u201eArschrakete\\u201c) angebracht werden.<\\/p>\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_class\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"date\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"subheader_class\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"assets\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"imagecols\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"frame_layout\\\":\\\"\\\",\\\"frame_options\\\":\\\"\\\",\\\"background_color_class\\\":\\\"\\\",\\\"background_image\\\":\\\"\\\",\\\"background_image_options\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"}}', 0, '0400$52f1b9c68029ab02f973673c6ec8cd19:ea41b626baac59a1fe0716bc344af5d9'),
(208, 1687442684, 2, 'BE', 1, 0, 15, 'pages', '{\"oldRecord\":{\"abstract\":null},\"newRecord\":{\"abstract\":\"Ein Rennrad ist insbesondere f\\u00fcr alle, die das Fahrradfahren als Sport betreiben m\\u00f6chten, gedacht. Durch sein geringes Gewicht und seine Bauweise kannst du mit dem Rennrad hohe Geschwindigkeiten erreichen. Aufgrund von seinen d\\u00fcnnen Reifen solltest du mit dem klassischen Rennrad nur auf Asphalt fahren.\"}}', 0, '0400$9781e111247c75856c4781515de07659:c97934f122918253f51c81fbe45fd105'),
