(213, 1687442813, 1, 'BE', 1, 0, 10, 'tt_content', '{\"uid\":10,\"rowDescription\":\"\",\"pid\":16,\"tstamp\":1687442813,\"crdate\":1687442813,\"cruser_id\":1,\"deleted\":0,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"fe_group\":\"\",\"sorting\":256,\"editlock\":0,\"sys_language_uid\":0,\"l18n_parent\":0,\"l10n_source\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l18n_diffsource\":\"\",\"t3ver_oid\":0,\"t3ver_wsid\":0,\"t3ver_state\":0,\"t3ver_stage\":0,\"CType\":\"textmedia\",\"header\":\"Kinderfahrr\\u00e4der\",\"header_position\":\"\",\"bodytext\":\"<p>Puky Kinderfahrrad Youke 18:<\\/p>\\r\\n<p>Kinder ab 5 Jahren werden mit diesem Kinderfahrrad sehr gl\\u00fccklich sein. Das Puky Youke 18 hat 18 Zoll gro\\u00dfe Reifen und ist mit allerhand praktischen Zubeh\\u00f6r (z. B. Gep\\u00e4cktr\\u00e4ger und Seitenst\\u00e4nder) ausgestattet. Es ist das Nachfolgemodell des Puky ZL 18.<br \\/> Das Puky Youke 18 mit Aluminium-Rahmen<\\/p>\\r\\n<p>Der Alu-Rahmen macht das Fahrrad im Gesamten leichter im Gewicht, was den Kleinen hilft. Auch die Felgen, der Lenker und die Pedal-Kurbel bestehen aus Alu. Das Puky Youke 18 wiegt nur 8,7 kg. Zus\\u00e4tzlich ist der Rahmen pulverlackiert, sodass der Rahmen sto\\u00dffest und robust ist.<br \\/> Puky ist sehr kinderorientiert und wei\\u00df, was die Kleinen beim Fahrrad brauchen: Deshalb hat dieses Kinderfahrrad auch wieder eine R\\u00fccktrittbremse, die von den Kids gerne benutzt wird. Auch eine Handbremse ist vorhanden.<\\/p>\",\"bullets_type\":0,\"uploads_description\":0,\"uploads_type\":0,\"assets\":0,\"image\":0,\"imagewidth\":0,\"imageorient\":0,\"imagecols\":1,\"imageborder\":0,\"media\":0,\"layout\":0,\"frame_class\":\"default\",\"cols\":0,\"space_before_class\":\"\",\"space_after_class\":\"\",\"records\":null,\"pages\":null,\"colPos\":0,\"subheader\":\"\",\"header_link\":\"\",\"image_zoom\":0,\"header_layout\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"linkToTop\":0,\"file_collections\":null,\"filelink_size\":0,\"fileli